import React from "react";

function LangSelector() {
  return (
    <div>
      <label className="mr10">
        <input
          type="radio"
          value="en"
          name="language"
          checked={selectedLang === "en"}
        />{" "}
        English
      </label>
      <label>
        <input
          type="radio"
          value="zh-Hant"
          name="language"
          checked={selectedLang === "zh-Hant"}
        />{" "}
        Chinese (Traditional)
      </label>
    </div>
  );
}

export default LangSelector;
